VALUES ('0064642024572', 'Vitamine C 500 mg', 'Directions-Adults: Chew 1 to 4 tablets daily. Store between 15\'C and 25 C, away from children.  Posologie - Adultes: Croquer de 1 à 4 comprimés par jour. Conserver entre 15 °C et 25 °C, hors de la portée des enfants.  Each tablet contains: Vitamin C (Ascorbic acid, Sodium ascorbate) Supporting botanical blend .... Derived from rutin (Dimorphandra mollis, pod), hesperidin Citrus sinensis, fruit), citrus bioflavonoids (Citrus limon, rind cerola cherry (4:1) extract (Malpighia glabra, fruit) equivalent toa 5.76 mg raw herb, rose hips (Rosa canina, fruit)  Also contains: Cellulose, vegetable stearic acid, vegetable magnesium stearate, silica, natural flavours (mango, tropical punch, passion fruit, kiwi), dextrose, sucralose.  Chaque comprimé contient:  Vitamine C (acide ascorbique, ascorbate de sodium)... 500 mg  Melange végétal de soutien .. 7 mg Derivé de rutine (Dimorphandra mollis, gousse), hespéridine (Citrus sinensis, fruit), bioflavonoides d\'agrumes (Citrus limon, pelure), extrait (4:1) de cerise des Antilles (Malpighia glabra fruit) équivalant à 5,76 mg d\'herbe brute, cynorrhodons Rosa canina, fruit) Contient également: Cellulose, acide stéarique végétal, stéarate de magnésium végétal, silice, arômes naturels (mangue, punch tropical, fruit de la passion, kiwi),  P T100 dextrose, sucralose. NO gluten, lactose, artificial colours or flavours. SANS gluten, lactose ni colorants et arômes artificiels. VEGETARIAN VEGETARIEN 93338668O NdN', 'https://static.openfoodfacts.org/images/products/006/464/202/4572/front_fr.4.400.jpg', '', '', '', '', '', '', '', '', '', '1');

